import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>Поле для поиска</p>
        <p>Список репо</p>
        <p>Paginator</p>
      </header>
    </div>
  );
}

export default App;
